/* *  */package ar.com.santanderrio.obp.servicios.marcaviajero.web.view;import java.util.List;/** * The Class TarjetaAsociada. */public class TarjetaAsociada {      /** The marca. */     private String marca;      /** The numero. */     private String numero;      /** The alias. */     private String alias;      /** The fecha inhabilitada. */     private List<RangoInhabilitacionView> fechaInhabilitada;          /**		 * * @return the marca.		 *		 * @return the marca		 */     public String getMarca() {         return marca;     }      /**		 * * @param marca the marca to set.		 *		 * @param marca		 *            the new marca		 */     public void setMarca(String marca) {         this.marca = marca;     }      /**		 * * @return the numero.		 *		 * @return the numero		 */     public String getNumero() {         return numero;     }      /**		 * * @param numero the numero to set.		 *		 * @param numero		 *            the new numero		 */     public void setNumero(String numero) {         this.numero = numero;     }      /**		 * * @return the alias.		 *		 * @return the alias		 */     public String getAlias() {         return alias;     }      /**		 * * @param alias the alias to set.		 *		 * @param alias		 *            the new alias		 */     public void setAlias(String alias) {         this.alias = alias;     }    /**	 * * @return the fechaInhabilitada.	 *	 * @return the fecha inhabilitada	 */    public List<RangoInhabilitacionView> getFechaInhabilitada() {        return fechaInhabilitada;    }    /**	 * * @param fechaInhabilitada the fechaInhabilitada to set.	 *	 * @param fechaInhabilitada	 *            the new fecha inhabilitada	 */    public void setFechaInhabilitada(            List<RangoInhabilitacionView> fechaInhabilitada) {        this.fechaInhabilitada = fechaInhabilitada;    } } 